INSERT INTO `wp_content_tabs_ultimate_list` (`id`, `styleid`, `title`, `files`, `css`) VALUES
(1, 1, 'Permohonan SKCK', '&lt;ol&gt; &lt;li&gt;Surat pengantar dari desa/kelurahan&lt;/li&gt; &lt;li&gt;Foto copy KTP dan KK&lt;/li&gt; &lt;li&gt;Pas foto 6 lembar untuk pekerjaan swasta, 8 lembar untuk CPNS&lt;/li&gt; &lt;/ol&gt;', NULL),
(2, 1, 'Permohonan KTP', '&lt;ol&gt; &lt;li&gt;Surat pengantar dari desa/kelurahan&lt;/li&gt; &lt;li&gt;KTP asli (untuk permohonan perpanjangan KTP)&lt;/li&gt; &lt;li&gt;Surat kehilangan dari kepolisian bagi KTP asli yang hilang&lt;/li&gt; &lt;li&gt;Akta nikah/cerai&lt;/li&gt; &lt;li&gt;Akta kelahiran&lt;/li&gt; &lt;li&gt;Foto copy KK&lt;/li&gt; &lt;/ol&gt;', NULL),
(3, 1, 'Permohonan KK', '&lt;ol&gt; &lt;li&gt;Surat pengantar dari desa/keluhan&lt;/li&gt; &lt;li&gt;Foto copy KTP&lt;/li&gt; &lt;li&gt;Foto copy KK lama&lt;/li&gt; &lt;li&gt;Surat pindah apabila pendatang&lt;/li&gt; &lt;li&gt;Foto copy akta nikah/cerai&lt;/li&gt; &lt;li&gt;Foto copy akta kelahiran/ijazah seluruh anggota keluarga&lt;/li&gt; &lt;/ol&gt;', NULL),
(4, 1, 'Rekomendasi surat pengantar ijin keramaian ke polsek/polres', '&lt;ol&gt; &lt;li&gt;Surat pengantar dari desa/kelurahan&lt;/li&gt; &lt;li&gt;Foto copy KTP&lt;/li&gt; &lt;li&gt;Keterangan jenis keramaian&lt;/li&gt; &lt;/ol&gt;', NULL),
(5, 1, 'Rekomendasi pengantar permohonan Akta Kelahiran', '&lt;ol&gt; &lt;li&gt;Surat pengantar dari desa/kelurahan&lt;/li&gt; &lt;li&gt;Foto copy KTP ortu&lt;/li&gt; &lt;li&gt;Foto copy KK&lt;/li&gt; &lt;li&gt;Foto copy surat nikah&lt;/li&gt; &lt;li&gt;Surat keterangan kelahiran dari desa dan bidan/RS&lt;/li&gt; &lt;/ol&gt;', NULL),
(6, 1, 'Surat Permohonan Pindah', '&lt;ol&gt; &lt;li&gt;Surat pengantar dari desa/kelurahan&lt;/li&gt; &lt;li&gt;KTP dan KK asli&lt;/li&gt; &lt;li&gt;Pas foto 4 x 6 sebanyak 6 lembar untuk perpindahan antar kecamatan, antar kabupaten 8 lembar dan 12 lembar untuk antar propinsi&lt;/li&gt; &lt;li&gt;Surat pindah antar kabupaten/propinsi legalisasi kecamatan dan penerbitan di dinpendukcapil&lt;/li&gt; &lt;/ol&gt;', NULL);
