(1171, 'elementor_remote_info_feed_data', 'a:3:{i:0;a:5:{s:5:\"title\";s:62:\"Introducing Action Links: Connect With Your Clients Seamlessly\";s:7:\"excerpt\";s:134:\"This week, we\'re releasing useful features that will help you connect with your site visitors, as well as analyze and track user data.\";s:7:\"created\";s:10:\"1543932850\";s:5:\"badge\";s:3:\"New\";s:3:\"url\";s:124:\"https://elementor.com/blog/introducing-action-links/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:1;a:5:{s:5:\"title\";s:52:\"Elementor Talks #13: Different Is Better Than Better\";s:7:\"excerpt\";s:241:\"Brian Dean, the founder of Backlinko and a leading SEO expert, talks with us about his favorite communication tools, explains how voice search is going to change the SEO game, and lists the most important skills for a marketer in 2018.​​\";s:7:\"created\";s:10:\"1543498676\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:121:\"https://elementor.com/blog/podcast-13-brian-dean/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:2;a:5:{s:5:\"title\";s:50:\"Grow Your Website Building Business With Elementor\";s:7:\"excerpt\";s:258:\"Our first live Facebook webinar sparked a lot of interest among our community members, who submitted dozens of questions to our guest and online marketing expert, Troy Dean. For those who missed it, we have recorded and summarized the webinar for you. Enjoy!\";s:7:\"created\";s:10:\"1543401135\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:117:\"https://elementor.com/blog/webinar-troy-dean/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}}', 'no'),
