(2, 1, '2018-09-10 05:48:56', '2018-09-09 22:48:56', 'Ini adalah contoh laman. Ini berbeda dengan posting blog karena akan tetap berada di satu tempat dan akan muncul di navigasi situs Anda (di kebanyakan tema). Kebanyakan orang memulai dengan laman Tentang yang mengenalkannya ke calon pengunjung situs. Biasanya terdengar seperti ini:\r\n<blockquote>Hai disana! Saya adalah pembawa sepeda siang hari, calon aktor di malam hari, dan ini adalah situs web saya. Saya tinggal di Los Angeles, punya anjing hebat bernama Jack, dan saya suka piña colada. (Dan tertangkap basah).</blockquote>\r\n... atau sesuatu seperti ini:\r\n<blockquote>The XYZ Doohickey Company didirikan pada tahun 1971, dan telah menyediakan doohickeys berkualitas kepada masyarakat sejak saat itu. Terletak di Gotham City, XYZ mempekerjakan lebih dari 2.000 orang dan melakukan segala hal yang mengagumkan untuk komunitas Gotham.</blockquote>\r\nSebagai pengguna WordPress baru, Anda harus membuka <a href=\"http://127.0.0.1:8080/kalimanah/wp-admin/\">dasbor</a> untuk menghapus halaman ini dan membuat halaman baru untuk konten Anda. Selamat bersenang-senang!', 'Laman Contoh', '', 'publish', 'closed', 'open', '', 'laman-contoh', '', '', '2018-09-10 10:32:57', '2018-09-10 03:32:57', '', 0, 'http://127.0.0.1:8080/kalimanah/?page_id=2', 0, 'page', '', 0),
