(82, 1, '2018-10-01 06:00:18', '2018-09-30 23:00:18', '<p style=\"text-align: justify;\">Assalammualaikum Wr. Wb.</p>\r\n<p style=\"text-align: justify;\">Alhamdulillahhirobbilalamin</p>\r\n<p style=\"text-align: justify;\">Dengan mengucapkan puji dan syukur kehadirat Allah SWT, kami sampaikan salam hangat bagi warga Kabupaten Purbalingga, khususnya warga Kecamatan Kalimanah. Selanjutnya dengan senang hati kami sampaikan informasi kepada Anda untuk mengenal lebih dekat kecamatan Kalimanah Kabupaten Purbalingga melalui situs resmi Kecamatan Kalimanah ini. Situs ini diharapkan akan memberikan informasi mengenai Kecamatan Kalimanah Kabupaten Purbalingga secara umum tentang pemerintahan, pembangunan dan kemasyarakatan, termasuk didalamnya, khasanah budaya, potensi ekonomi dan pariwisata, yang selalanjutnya dapat digunakan dinas instansi terkait dan stakeholder lainnya dalam rangka pelaksanaan program-progam pembangunan di Kecamatan Kalimanah Kabupaten Purbalingga untuk meningkatkan kesejahteraan masyarakat.</p>\r\n<p style=\"text-align: justify;\">Jenderal Besar Sudirman pernah berkata \"untuk menang, kita harus kuat, untuk kuat kita harus bersatu, agar kita dapat bersatu kita harus memelihara tali silaturrahhim\", untuk itu kami mengingatkan kepada selurah elemen masyarakat, mari kita menjaga persatuan dan kesatuan dengan tetap memelihara tali silaturrahhim demi keberhasilan program-program pembangunan di Kabupaten Purbalingga.</p>\r\n<p style=\"text-align: justify;\">Semboyan Purbalingga Perwira kita jadikan motivasi dalam bekerja demi terwujudnya Kabupaten Purbalingga yang Baldatun Toyyibatun Warobun Ghofur.</p>\r\n<p style=\"text-align: justify;\">Wabillahi Taufik Walhidayah, Wassalammualaikum Wr. Wb.</p>\r\n&nbsp;\r\n<p style=\"text-align: justify;\">Kalimanah, November 2018</p>\r\n<p style=\"text-align: justify;\">CAMAT</p>\r\n<p style=\"text-align: justify;\">Drs. HARSONO</p>\r\n<p style=\"text-align: justify;\"></p>', 'Sambutan Camat Kecamatan Kalimanah', '', 'publish', 'closed', 'closed', '', 'sambutan-camat-kecamatan-kalimanah', '', '', '2018-12-09 19:43:47', '2018-12-09 12:43:47', '', 0, 'http://127.0.0.1:8080/kalimanah/?page_id=82', 0, 'page', '', 0),
(83, 1, '2018-10-01 05:59:17', '2018-09-30 22:59:17', '<h1>Assalammualaikum Wr. Wb.</h1>\r\nAlhamdulillahhirobbilalamin\r\n\r\nDENGAN mengucapkan puji dan syukur kehadirat Allah SWT, kami sampaikan salam hangat bagi warga Kota Jambi, khususnya warga Kecamatan Kotabaru. Selanjutnya dengan senang hati kami sampaikan informasi kepada Anda untuk mengenal lebih dekat kecamatan Kotabaru Kota Jambi melalui situs resmi Kecamatan Kotabaru ini. Situs ini diharapkan akan memberikan informasi mengenai Kecamatan Kotabaru Kota Jambi secara umum tentang pemerintahan, pembangunan dan kemasyarakatan, termasuk didalamnya, khasanah budaya, potensi ekonomi dan pariwisata, yang selalanjutnya dapat digunakan dinas instansi terkait dan stakeholder lainnyya dalam rangka pelaksanaan program-progam pembangunan di Kecamatan Kotabaru Kota Jambi untuk meningkatkan kesejahteraan masyarakat.\r\n\r\nJenderal Besar Sudirman pernah berkata \"untuk menang, kita harus kuat, untuk kuat kita harus bersatu, agar kita dapat bersatu kita harus memelihara tali silaturrahhim\", untuk itu kami mengingatkan kepada selurah elemen masyarakat, mari kita menjaga persatuan dan kesatuan dengan tetap memelihara tali silaturrahhim demi keberhasilan program-program pembangunan di Kota Jambi.\r\n\r\nSemboyan 3 Tahun Jambi Bangkit , BANGKIT (Bersih, Aman, PembaNGunan, Kemandirian, Indah, Taqwa) kita jadikan motivasi dalam bekerja demi terwujudnya Kota Jambi yang Baldatun Toyyibatun Warobun Ghofur.\r\n\r\nWabillahi Taufik Walhidayah, Wassalammualaikum Wr. Wb.\r\n\r\n&nbsp;\r\n\r\nKotabaru, 2015\r\n\r\nCamat Kotabaru\r\n\r\n&nbsp;\r\n\r\nFERIADI, S.Sos.', 'Sambutan Camat Kecamatan Kalimanah', '', 'inherit', 'closed', 'closed', '', '82-revision-v1', '', '', '2018-10-01 05:59:17', '2018-09-30 22:59:17', '', 82, 'http://127.0.0.1:8080/kalimanah/2018/10/01/82-revision-v1/', 0, 'revision', '', 0),
