(233, 1, '2018-11-07 08:41:51', '2018-11-07 01:41:51', '<p style=\"text-align: justify;\"><strong>VISI</strong></p>\r\n<p style=\"text-align: justify;\">PURBALINGGA YANG MANDIRI DAN BERDAYA SAING, MENUJU MASYARAKAT SEJAHTERA YANG BERAKHLAK MULIA/ BERAKHLAQUL KARIMAH</p>\r\n<p style=\"text-align: justify;\"><strong>MISI</strong></p>\r\n\r\n<ol>\r\n 	<li style=\"text-align: justify;\">MENYELENGGARAKAN PEMERINTAH YANG PROFESIONAL, EFISIEN, EFEKTIF, BERSIH DAN DEMOKRATIS SEHINGGA MAMPU MEMBERIKAN PELAYANAN SECARA PRIMA KEPADA MASYARAKAT;</li>\r\n 	<li style=\"text-align: justify;\">MENDORONG KEHIDUPAN MASYARAKAT RELIGIUS YANG BERIMAN DAN BERTAQWA KEHADIRAT ALLAH SWT/ TUHAN YME, SERTA MENGEMBANGKAN PAHAM KEBANGSAAN, GUNA MEWUJUDKAN RASA AMAN DAN TENTRAM DALAM MASYARAKAT YANG BERDASAR PADA REALITAS KEBHINEKAAN;</li>\r\n 	<li style=\"text-align: justify;\">MENGUPAYAKAN PEMENUHAN KECUKUPAN KEBUTUHAN POKOK MANUSIA UTAMANYA PANGAN DAN PAPAN SECARA LAYAK;</li>\r\n 	<li style=\"text-align: justify;\">MENINGKATKAN KUALITAS SUMBAR DAYA MANUSIA, UTAMANYA MELALUI PENINGKATAN DERAJAT PENDIDIKAN DAN DERAJAT KESEHATAN MASYARAKAT;</li>\r\n 	<li style=\"text-align: justify;\">MEMPERCEPAT PERTUMBUHAN DAN PEMERATAAN EKONOMI RAKYAT, DENGAN MENDORONG SIMPUL-SIMPUL PEREKONOMIAN UTAMANYA INDUSTRI PENGOLAHAN DAN MANUFAKTUR, PERDAGANGAN, JASA, PARIWISATA DAN INDUSTRI KREATIF, DENGAN TETAP BERORIENTASI PADA KEMITRAAN DAN PENGEMBANGAN POTENSI LOKAL, SERTA DIDUKUNG DENGAN PENCIPTAAN IKLIM KONDUSIF UNTUK PENGEMBANGAN USAHA, INVESTASI DAN PENCIPTAAN LAPANGAN KERJA;</li>\r\n 	<li style=\"text-align: justify;\">MEWUJUDKAN KAWASAN PERKOTAAN DAN PERDESAAN YANG SEHAT DAN MENARIK UNTUK MELAKSANAKAN KEGIATAN EKONOMI, SOSIAL, DAN BUDAYA MELALUI  GERAKAN MASYARAKAT, YANG DIDUKUNG DENGAN PENYEDIAAN INFRASTRUKTUR DAN SARANA PRASARANA WILAYAH YANG MEMADAI;</li>\r\n 	<li style=\"text-align: justify;\">MEWUUDKAN KELESTARIAN FUNGSI LINGKUNGAN HIDUP.</li>\r\n</ol>', 'Visi Misi', '', 'publish', 'closed', 'closed', '', 'visi-misi', '', '', '2018-12-09 20:25:45', '2018-12-09 13:25:45', '', 0, 'http://localhost/kalimanah/?page_id=233', 0, 'page', '', 0),
