(287, 1, '2018-12-09 22:24:55', '2018-12-09 15:24:55', '<h3 style=\"text-align: center;\"><strong>ALUR KEGIATAN PELAYANAN</strong></h3>\r\n<h3 style=\"text-align: center;\"><strong>KECAMATAN KALIMANAH</strong></h3>\r\n<p style=\"text-align: justify;\"><strong> </strong></p>\r\n\r\n<ol>\r\n 	<li style=\"text-align: justify;\">PEMOHON MENDAFTARKAN DIRI PADA MEJA PELAYANAN DI KANTOR KECAMATAN KALIMANAH DENGAN MEMBAWA PERSYARATAN YANG TELAH DITENTUKAN</li>\r\n 	<li style=\"text-align: justify;\">PETUGAS MENCATAT LEGALISASI SURAT PERMOHONAN DAN MENERUSKAN KEPADA PEJABAT YANG BERWENANG. (APABILA PERSYARATAN LENGKAP DITERUSKAN, APABILA PERSYARATAN TIDAK LENGKAP DIKEMBALIKAN KE PEMOHON UNTUK DILENGKAPI</li>\r\n 	<li style=\"text-align: justify;\">PETUGAS MENGAJUKAN BERKAS PEMOHON KEPADA PEJABAT YANG BERWENANG</li>\r\n 	<li style=\"text-align: justify;\">PEJABAT BERWENANG MENELITI DAN MENANDATANGANI BERKAS PERMOHONAN YANG DIAJUKAN UNTUK DIPROSES LEBIH LANJUT</li>\r\n 	<li style=\"text-align: justify;\">PETUGAS MEREGISTRASI PERMOHONAN YANG TELAH DITANDATANGANI, SELANJUTNYA DIPROSES SESUAI DENGAN JENIS PERMOHONAN YANG BERSANGKUTAN.</li>\r\n</ol>', 'ALUR KEGIATAN PELAYANAN', '', 'publish', 'closed', 'closed', '', 'alur-kegiatan-pelayanan', '', '', '2018-12-09 22:24:55', '2018-12-09 15:24:55', '', 0, 'http://localhost/kalimanah/?page_id=287', 0, 'page', '', 0),
(288, 1, '2018-12-09 22:24:55', '2018-12-09 15:24:55', '<h3 style=\"text-align: center;\"><strong>ALUR KEGIATAN PELAYANAN</strong></h3>\r\n<h3 style=\"text-align: center;\"><strong>KECAMATAN KALIMANAH</strong></h3>\r\n<p style=\"text-align: justify;\"><strong> </strong></p>\r\n\r\n<ol>\r\n 	<li style=\"text-align: justify;\">PEMOHON MENDAFTARKAN DIRI PADA MEJA PELAYANAN DI KANTOR KECAMATAN KALIMANAH DENGAN MEMBAWA PERSYARATAN YANG TELAH DITENTUKAN</li>\r\n 	<li style=\"text-align: justify;\">PETUGAS MENCATAT LEGALISASI SURAT PERMOHONAN DAN MENERUSKAN KEPADA PEJABAT YANG BERWENANG. (APABILA PERSYARATAN LENGKAP DITERUSKAN, APABILA PERSYARATAN TIDAK LENGKAP DIKEMBALIKAN KE PEMOHON UNTUK DILENGKAPI</li>\r\n 	<li style=\"text-align: justify;\">PETUGAS MENGAJUKAN BERKAS PEMOHON KEPADA PEJABAT YANG BERWENANG</li>\r\n 	<li style=\"text-align: justify;\">PEJABAT BERWENANG MENELITI DAN MENANDATANGANI BERKAS PERMOHONAN YANG DIAJUKAN UNTUK DIPROSES LEBIH LANJUT</li>\r\n 	<li style=\"text-align: justify;\">PETUGAS MEREGISTRASI PERMOHONAN YANG TELAH DITANDATANGANI, SELANJUTNYA DIPROSES SESUAI DENGAN JENIS PERMOHONAN YANG BERSANGKUTAN.</li>\r\n</ol>', 'ALUR KEGIATAN PELAYANAN', '', 'inherit', 'closed', 'closed', '', '287-revision-v1', '', '', '2018-12-09 22:24:55', '2018-12-09 15:24:55', '', 287, 'http://localhost/kalimanah/2018/12/09/287-revision-v1/', 0, 'revision', '', 0);
